import re


def checkInclusion(s1: str, s2: str) -> bool:
    begin = 0
    state = 0  # 匹配状态，0为未开始，1为开始匹配
    i = 0
    all_s1 = s1
    while i < (len(s2)):
        if s1 == '':
            return True

        if state == 0:
            if s2[i] in s1:
                # 进入匹配状态
                state = 1
                begin = i
                # s1 = s1.replace(s2[i], '')
                s1 = re.sub(s2[i], '', s1, 1)



        elif state == 1:
            if s2[i] in s1:

                # s1 = s1.replace(s2[i], '')
                s1 = re.sub(s2[i], '', s1, 1)


            else:
                s1 = all_s1
                i = begin
                state = 0
        i = i + 1

    if s1 == '':
        return True
    else:
        return False
def SlipWindow(s1,s2):
    if len(s1)>len(s2): return False
    s1_L = len(s1)
    for i in range(0,len(s2)-s1_L+1):
        if sorted(s2[i:i+s1_L]) == sorted(s1):
            return True
    return False





